    data: |
      SELECT DISTINCT + col1 * + col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 + ( col1 + col2 ) * col2 BETWEEN NULL AND - col2 * col0;
  - name: tab0

outputs:
  - name: q10332.out
    data: |
